  false,\n\t\"url\": null,\n\t\"notes\": \"Over the past five years, the East-West
  Gateway Council of Governments has facilitated creation of data layers to enhance
  conservation and transportation planning in a seven-county area around St. Louis.
  Upland communities were treated separately from big river floodplains, where special
  efforts were made to address wetlands. Wetland mapping for big river floodplains
  included (1) development of LiDAR-based digital terrain models (DTMs) at 5 meter
  resolution, (2) development of digital surface models (DSMs), (3) subtraction of
  DTM from DSM to identify vegetation height, and (3) creation of image objects at
  5 meter resolution from LiDAR data. These data were used to create a Cowardin classification
  of wetlands based on hydrology (low areas from the DTM, modified by digital soil
  survey impermeable soils information) and vegetation height (modified by life form
  from traditional land cover classification). Wetland patches were then formed and
  scored for importance based on biological and landscape context attributes. Wetland
  restoration scores were applied to cropland based on landscape context and hydrology
  from the DTM. These data have been delivered to more than a dozen partners for use
  in planning. Impacts to important wetlands can be avoided or minimized, and mitigation
  or restoration can be directed toward higher-scored extant wetlands or more important
  wetland restoration areas.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
